Welcome. I am a functional medicine and wellness practitioner and am excited you are here. I love what I do and have helped countless men and women of all ages change their life for the better. I started my practice in 2015, after completing residency in Preventive Medicine at Loma Linda University and giving birth to my 3rd child. During my training, I learned from the best in the field, including Dean Ornish, Caldwell Esselstyn, and Andrew Weil. I completed further certifications in functional medicine and hormone therapy through the Institute for Functional Medicine (IFM), the American Academy of Anti-Aging Medicine (A4M), and BioTE. I am passionate about helping men and women address the root cause of their symptoms, whether through gut healing, hormone replacement, toxicities, allergies, or nutrient deficiencies. I attend multiple trainings and conferences throughout the year in order to stay current on the latest trends and developments in functional medicine.
&nbsp;
**Note: The other providers at this practice are open to taking in new patients. Dr. Taylor is taking referrals only

Grace personal training offers a tailor made, comprehensive service in the comfort and safety of your own home or in her personal gym space, located at her residence.

Grace has been a trainer for over 10 years, is a qualified NASM CPT and CES trainer and has also obtained her pilates reformer qualification through balanced body. She will be offering private pilates sessions in her personal gym in summer 2021!&nbsp;

Along with those qualifications, she has also received certificates specialising in women's fitness, pre and post natal training, kettlebells, TRX and boxing coaching.

Grace is also a black belt in Tae Kwon do.&nbsp;

Grace is a friendly, knowledgeable and reliable trainer who will work tirelessly to help you reach your goals and get the results you want, all while having fun!

Together you will achieve those goals with an individual training and nutrition plan.&nbsp;

That's enough about Grace! What she really wants to hear about is your goals, what you enjoy and how she can help you realize your true fitness potential.&nbsp;

If this sounds like something you're looking for, Grace offers a free 30-minute consultation for new clients to discuss goals. She will also conduct a simple fitness assessment to see where your fitness levels are at.

Thanks for reading and we look forward to training with you soon.

Essential Medical Clinic is a leading private medical practice with state-of-the-art clinics conveniently located in the Westlake, Downtown, and Athens neighborhoods of Los Angeles, California. Sultan Shah, MD, Pouya Bahrami, DO, and the team provide a full range of high-quality health care services to patients over the age of 18, delivering care that's patient-oriented, comprehensive, and supportive.&nbsp;
The team of skilled providers at Essential Medical Clinic is united by a common goal: to help their patients achieve a healthier lifestyle. Realizing that health is more than just a number, they take a unique approach to their mission by treating their patients as whole people. Their unique brand of care goes beyond treating the medical condition at hand and strives to address the psychosocial and nutritional needs of the individual.
Essential Medical Clinic offers a broad spectrum of services, including physicals, IV fluids, vitamin therapy, weight loss, and urgent care. Their offices are equipped with walk-in clinics, and they provide telemedicine appointments for patients who are too busy or unable to physically come in to the office. The practice also provides its patients with tested and certified medical-grade supplements and can dispense common over-the-counter medications.

