About&nbsp;Dr. McCabe
By nature, Patrick McCabe, DC, is a caring, considerate individual with a passion for connecting his patients back to themselves and helping them meet their performance potential. At his practice, Alpha Life Chiropractic, Dr. McCabe brings top-tier chiropractic care to the community of Irving, Texas, and the surrounding area. He offers time- and cost-effective options for chiropractic care and functional medicine while taking the time to explain his patients' conditions and treatment in depth. Dr. McCabe takes a personal interest in each of his patients so he can help them achieve their best overall health and well-being.&nbsp;
After earning his degree in kinesiology with a concentration in chemistry from the University of Miami in Coral Gables, Florida, Dr. McCabe went on to learn, mentor, and teach at Parker University in Dallas. There, he earned his doctor of chiropractic degree and became board certified and licensed in the state of Texas. Dr. McCabe continues to pursue functional medicine and functional neurology diplomates while he serves patients of all ages at his private practice.&nbsp;
While earning his doctorate in chiropractic, Dr. McCabe honed his skills by working in a number of clinics and tutoring many of his peers in various chiropractic adjustment techniques. On a daily basis at Alpha Life Chiropractic, he helps his patients gain an understanding of the relationship between spinal hygiene and quality movement...

My goal is to cultivate health through acupuncture by improving blood and oxygen circulation throughout your body &amp; calming your nervous system to restore depleted energy. Breathe deeply. Rest. Let your body heal.&nbsp;

Restore internal organ balance with customized herbal medicines. Working from within, both Eastern and Western herbs can help your body regain optimal function and achieve a state of harmony and health.&nbsp;

Build strength through eating whole foods. Nutrition and food therapy plans are developed for each patient so that you may create a solid foundation for future health for yourself and your family. Food matters.

Please note that my practice is by appointment only &amp; services include Cupping, Guasha, Postpartum Treatment, &amp; More!
